import Header from './Components/Header';
import About from './Components/About';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {

  return (
    <>
    <></>
    <div className="App">

          <Route path="/about">
            <About />
          </Route>

          <Route path="/">
          <Header/>
          </Route>

    </div>

    </>
  );
}

export default App;
